// @downloadURL https://update.greasyfork.org/scripts/528085/Random%20Edio%20Logos.user.js
// @updateURL https://update.greasyfork.org/scripts/528085/Random%20Edio%20Logos.meta.js
// ==/UserScript==

(function () {
    const logoSelector = "https://www.myedio.com/assets/img/logo/edio-logo@2x.png";
    const imageTable = {
        default: [
            // More Coming Soon..
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,"
        ],
        special: {
            0: "data:image/png;base64,",
            5: "data:image/png;base64,",
            9: "data:image/png;base64,",
            11: "data:image/png;base64,",
        }
    };

    function shouldChangeLogo() {
        return Math.random() < 0.2;
    }

    function getReplacementImage() {
        const month = new Date().getMonth();
        if (imageTable.special[month]) {
            return imageTable.special[month];
        }
        return imageTable.default[Math.floor(Math.random() * imageTable.default.length)];
    }

    function replaceLogos() {
        document.querySelectorAll('img').forEach(img => {
            if (img.src === logoSelector && (shouldChangeLogo() || imageTable.special[new Date().getMonth()])) {
                img.src = getReplacementImage();
            }
        });
    }

    const observer = new MutationObserver(() => replaceLogos());
    observer.observe(document.body, { childList: true, subtree: true });

    replaceLogos();
})();